import Nav from '../components/nav'
import ToggleButton from '../components/ToggleButton';

export default function IndexPage() {
  const [toggle, setToggle] = useState(false);

  const onToggle = () => {
    setToggle(!toggle);
  };

  return (
    <ToggleButton onToggle={onToggle} />
  )
}
